import React from "react";
import BackgroundComponent from "./components/BackgroundComponent";
import bgImage from "./img/login_background.jpg";
import ButtonComponent from "./components/ButtonComponent";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
function App() {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/about">About</Link>
            </li>
            <li>
              <Link to="/users">Users</Link>
            </li>
          </ul>
        </nav>
        {
          <Switch>
            <Route path="/about">
              <About />
            </Route>
          </Switch>
        }
      </div>
    </Router>
  );
}

function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
export default App;
